import React from 'react';
import { Routes, Route, Link, useLocation } from 'react-router-dom';

const PatientDashboard = () => {
  const location = useLocation();

  const navItems = [
    { name: 'Accueil', path: '/patient', icon: 'üè†' },
    { name: 'Rendez-vous', path: '/patient/rendez-vous', icon: 'üìÖ' },
    { name: 'Dossier', path: '/patient/dossier', icon: 'üìÅ' },
    { name: 'Consultations', path: '/patient/consultations', icon: 'ü©∫' }
  ];

  const DashboardHome = () => (
    <div className="p-8 bg-white rounded-xl shadow-sm border">
      <h1 className="text-3xl font-bold mb-4 text-gray-900">Bienvenue dans votre espace patient</h1>
      <p className="text-gray-600 mb-8">S√©lectionnez une section dans le menu de gauche</p>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <Link to="/patient/rendez-vous" className="p-6 bg-blue-50 border-2 border-blue-100 rounded-xl hover:shadow-md transition-all">
          <h3 className="text-xl font-semibold text-blue-800 mb-2">üìÖ Mes Rendez-vous</h3>
          <p className="text-blue-600">G√©rez vos RDV m√©dicaux</p>
        </Link>
        <Link to="/patient/consultations" className="p-6 bg-green-50 border-2 border-green-100 rounded-xl hover:shadow-md transition-all">
          <h3 className="text-xl font-semibold text-green-800 mb-2">ü©∫ Mes Consultations</h3>
          <p className="text-green-600">Historique complet</p>
        </Link>
      </div>
    </div>
  );

  const MesRendezVous = () => (
    <div className="p-8 bg-white rounded-xl shadow-sm border">
      <h1 className="text-3xl font-bold mb-6">üìÖ Mes Rendez-vous</h1>
      <p>Liste des rendez-vous √† venir...</p>
    </div>
  );

  const MonDossier = () => (
    <div className="p-8 bg-white rounded-xl shadow-sm border">
      <h1 className="text-3xl font-bold mb-6">üìÅ Mon Dossier M√©dical</h1>
      <p>Votre historique m√©dical complet...</p>
    </div>
  );

  const MesConsultations = () => (
    <div className="p-8 bg-white rounded-xl shadow-sm border">
      <h1 className="text-3xl font-bold mb-6">ü©∫ Mes Consultations</h1>
      <div className="grid gap-6">
        <div className="p-6 bg-blue-50 border-2 border-blue-100 rounded-xl">
          <h3 className="text-xl font-semibold mb-2">Consultation 15 Janvier</h3>
          <p className="text-gray-600">Dr. Awa Ndiaye - Cardiologie</p>
        </div>
        <div className="p-6 bg-green-50 border-2 border-green-100 rounded-xl">
          <h3 className="text-xl font-semibold mb-2">Consultation 10 Janvier</h3>
          <p className="text-gray-600">Dr. Mamadou Diop - P√©diatrie</p>
        </div>
      </div>
    </div>
  );

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Sidebar */}
      <div className="fixed h-full w-64 bg-white shadow-lg lg:block hidden z-40">
        <div className="p-6 border-b">
          <h1 className="text-2xl font-bold text-gray-900">Patient Portal</h1>
        </div>
        <nav className="p-4 space-y-2">
          {navItems.map(item => (
            <Link
              key={item.path}
              to={item.path}
              className={`flex items-center p-3 rounded-lg w-full transition-colors ${
                location.pathname === item.path
                  ? 'bg-blue-100 text-blue-800 border-r-4 border-blue-500'
                  : 'text-gray-700 hover:bg-gray-100'
              }`}
            >
              <span className="mr-3 text-lg">{item.icon}</span>
              {item.name}
            </Link>
          ))}
        </nav>
      </div>

      {/* Content */}
      <div className="lg:ml-64 p-6">
        <Routes>
          <Route path="/" element={<DashboardHome />} />
          <Route path="/rendez-vous" element={<MesRendezVous />} />
          <Route path="/dossier" element={<MonDossier />} />
          <Route path="/consultations" element={<MesConsultations />} />
          <Route path="*" element={<div className="p-8 text-center text-gray-500">Page non trouv√©e</div>} />
        </Routes>
      </div>
    </div>
  );
};

// ‚úÖ EXPORTS pour compatibilit√© App.js
export const PatientLayoutWrapper = ({ children }) => <>{children}</>;
export const DashboardHome = () => (
  <div className="p-8">
    <h1>Accueil Patient</h1>
  </div>
);

export default PatientDashboard;
